select(2, ...).LoadData("APP_INFO","Global",[[return {version=403,lastSync=1579974118,message={id=0,msg=""},news={{title="TradeSkillMaster v4.9.18 Changelog",content="TSM v4.9.18 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Minor change to how TSM scans auctions.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579870591,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-18-changelog/"},{title="TradeSkillMaster v4.9.17 Changelog",content="TSM v4.9.17 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* The total posted auction stats in My Auctions will no longer include sold auctions<br />* Fixed issue with custom price source updates not properly reflecting until a reload<br />* Fixed issue with creating new profiles not working<br />* [Retail] Fixed issue with Accounting recording of purchases and sales with multiple sellers / buyers<br />* [Retail] Added new 8.3 bonusIds<br />* [Retail] Added &#8220;MAX&#8221; button to Shopping's commodity buyout confirmation dialog<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579462276,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-17-changelog/"},{title="TradeSkillMaster v4.9.16 Changelog",content="TSM v4.9.16 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed issue with items not showing in Shopping search results in some situations<br />* [Retail] Fixed My Auctions total amounts<br />* [Retail] Fixed false-positive phasing messages<br />* [Retail] Fixed error after stopping a scan<br />* [Retail] Fixed issue with how Auctioning was rounding prices to the nearest silver<br />* [Retail] Fixed issue with trying to buy commodity items not always finding the auction<br />* [Retail] Fixed issue with purchased auctions not being counted towards mail inventory<br />* [Retail] Fixed issue with Shopping buy confirmation showing the incorrect auction price<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579231740,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-16-changelog/"},{title="TradeSkillMaster v4.9.15 Changelog",content="TSM v4.9.15 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Auctioning will now report a buyout above the gold cap as invalid<br />* [Retail] Fixed issue with changing the Auctioning post price<br />* [Retail] Fixed duration filtering in My Auctions<br />* [Retail] Fixed posted / sold auction totals in My Auctions<br />* [Retail] Fixed various issues with scans getting stuck<br />* [Retail] Fixed error when opening some AH mail<br />* [Retail] Optimized item-based scans (Auctioning and some Shopping scans)<br />* [Retail] Fixed issue with cancel scan incorrectly showing an auction as undercut immediately after posting<br />* [Retail] Fixed issue with cancel scan incorrectly showing auctions as undercut by the player<br />* [Retail] Fixed issue with auction order in the various auction table UIs<br />* [Retail] Fixed issue with default stack size when posting via Shopping<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579212789,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-15-changelog/"},{title="TradeSkillMaster v4.9.14 Changelog",content="TSM v4.9.14 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Fixed issue with auction selection.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1579134857,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-14-changelog/"},{title="TradeSkillMaster v4.9.13 Changel